  false,\n\t\"url\": null,\n\t\"notes\": \"These data (updated daily) are from the
  Global Tagging of Pelagic Predators (GTOPP) program.  Begun as one of the field
  projects in the international Census of Marine Life, the Pacific-focused TOPP (Tagging
  of Pacific Predators) program was an international multidisciplinary collaboration
  of more than 75 scientists from 7 nations.  Over the decade beginning in 2000, TOPP
  researchers deployed more than 4,300 electronic tags on 23 different species of
  marine animals - yielding a dataset of more than 335,000 tracking days. To learn
  more please visit http://topp.org or the ongoing Global Tagging of Pelagic Predators
  program at http://gtopp.org.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
